class RightSidebarComponent {
    constructor(openPlaylistService, loadJsService, usersService, friendsService) {
        this.openPlaylistService = openPlaylistService;
        this.loadJsService = loadJsService;
        this.usersService = usersService;
        this.friendsService = friendsService;
        this.hasClicked = false;
        this.userArray = [];
        this.friendArray = [];
        this.clickedForSearch = false;
        // this.loadJsService.loadJs()
    }
    showSideBar() {
        if (this.hasClicked) {
            this.hasClicked = false;
        }
        else {
            this.hasClicked = true;
        }
    }
    searchFriend(data) {
        this.clickedForSearch = true;
        var postData = {
            name: data.target.value
        };
        this.getFriendSearch(postData);
    }
    ngOnInit() {
        this.getAllUsersData();
    }
    getAllUsersData() {
        this.usersService.getAllUsers().subscribe(data => {
            this.userArray = data.result;
        }, err => {
            console.log('error :::::', err);
        });
    }
    getFriendSearch(postData) {
        this.friendsService.search(postData).subscribe(data => {
            this.friendArray = data.result;
        }, err => {
            console.log('error in friend search :::::', err);
        });
    }
}
